import React from "react";
import { useGlobalContext } from "./context";

function Home() {
  const { data } = useGlobalContext();

  console.log(data);
  return data.map((el) => {
    const { id, paymentDue, clientName, total, status } = el;
    return (
      <div className="info__component">
         <ul>
             <li>{id}</li>
             <li></li>
             <li></li>
             <li></li>
             <li></li>
         </ul>
         <p></p>
        <h1>{paymentDue}</h1>;
        <p>{clientName}</p>
        <h1>{total}</h1>
        <h1>{status}</h1>
      </div>
    );
  });
}

export default Home;
